def my_func(input1: str):
    if not (1 <= len(input1) <= 20):
        return None
    words = input1.split(' ')
    for i in range(len(words)):
        parts = words[i].split('-')
        for j in range(1, len(parts)):
            parts[j] = parts[j].capitalize()
        words[i] = ''.join(parts)
    return ' '.join(words)
